import React, { useState, useContext, useRef, useEffect } from "react";
import { NavLink, useLocation } from "react-router-dom";
import CartContext from "../context/cartContext/cartContext";
import useAuth from "../context/userContext/useAuth";

export const Navbar: React.FC = () => {
  const location = useLocation();
  const [navbarOpen, setNavbarOpen] = useState<boolean>(false);
  const [dropdownOpen, setDropdownOpen] = useState<boolean>(false);
  const { cartItems } = useContext(CartContext);
  const { user, message, logout } = useAuth();
  const dropdownRef = useRef<HTMLLIElement | null>(null);

  useEffect(() => {
    const handleClickOutside = (event: MouseEvent) => {
      if (dropdownRef.current && event.target instanceof Node && !dropdownRef.current.contains(event.target)) {
        setDropdownOpen(false);
      }
    };

    document.addEventListener("mousedown", handleClickOutside);
    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, []);

  const toggleDropdown = () => setDropdownOpen(!dropdownOpen);

  return (
    <>
      <nav className="relative flex flex-wrap items-center justify-between px-2 py-3 bg-slate-500">
        {message && location.pathname !== "/users/login" ? (
          <div
            className="fixed w-1/2 inset-x-0 max-w-max mx-auto top-1 transition-opacity ease-in duration-300 bg-opacity-80 bg-green-100 rounded-lg py-1 px-2  text-base text-green-700"
            role="alert"
          >
            {message}
          </div>
        ) : (
          ""
        )}
        <div className="container px-4 mx-auto flex flex-wrap items-center justify-between">
          <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start">
            <NavLink
              className="text-lg font-bold leading-relaxed inline-block mr-4 py-2 whitespace-nowrap text-white"
              to="/"
            >
              <img src ="../../../uploads/logo.webp" alt = "Logo" className="inline-block mr-2 logo-image"/>
              Pet Adoption Hub
            </NavLink>
            <button
              className="text-white cursor-pointer text-xl leading-none px-3 py-1 border border-solid border-transparent rounded bg-transparent block lg:hidden outline-none focus:outline-none"
              type="button"
              onClick={() => setNavbarOpen(!navbarOpen)}
            >
              <i className="fas fa-bars"></i>
            </button>
          </div>
          <div
            className={
              "lg:flex flex-grow items-center" +
              (navbarOpen ? " flex" : " hidden")
            }
            id="example-navbar-danger"
          >
            <ul className="flex flex-col lg:flex-row list-none lg:ml-auto">
              <li className="nav-item">
                <NavLink
                  onClick={() => setNavbarOpen(false)}
                  className="px-2 py-2 flex items-center text-s  leading-snug text-white hover:no-underline"
                  to={"/about"}
                >
                  <span className="ml-2">Home</span>
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink
                  onClick={() => setNavbarOpen(false)}
                  className="px-2 py-2 flex items-center text-s  font-bold leading-snug text-white hover:no-underline"
                  to={"pets/"}
                >
                  <span className="ml-2">Find a Pet</span>
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink
                  onClick={() => setNavbarOpen(false)}
                  className="px-2 py-2 flex items-center text-s font-bold leading-snug text-white hover:no-underline"
                  to="/petAdvice"
                >
                  <span className="ml-2">Adoption Advice</span>
                </NavLink>
              </li>
              <li className="nav-item relative" ref={dropdownRef}>
                <button
                  onClick={toggleDropdown}
                  className="px-2 py-2 flex items-center text-s font-bold leading-snug text-white hover:no-underline"
                >
                  <span className="ml-2">Resources</span>
                  <svg className="w-4 h-4 ml-1" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M19 9l-7 7-7-7"></path>
                  </svg>
                </button>
                {dropdownOpen && (
                  <div className="absolute right-0 mt-2 w-48 bg-white rounded-md shadow-lg py-1 z-10">
                    <NavLink to="/training" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100" onClick={() => setDropdownOpen(false)}>Training Tips</NavLink>
                    <NavLink to="/nutrition" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100" onClick={() => setDropdownOpen(false)}>Pet Nutrition</NavLink>
                    <NavLink to="/health" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100" onClick={() => setDropdownOpen(false)}>Health Guide</NavLink>
                  </div>
                )}
              </li>
              <li className="nav-item buttonNew">
                {user ? (
                  <NavLink
                    onClick={() => setNavbarOpen(false)}
                    className="px-2 py-2 flex items-center text-s  leading-snug text-white hover:no-underline"
                    to="users/my-account"
                  >
                    <span className="ml-2">My Profile</span>
                  </NavLink>
                ) : (
                  <NavLink
                    onClick={() => setNavbarOpen(false)}
                    className="px-2 py-2 flex items-center text-s  leading-snug text-white hover:no-underline"
                    to="users/login"
                  >
                    <span className="ml-2">Login</span>
                  </NavLink>
                )}
              </li>
              <li className="nav-item buttonSignup">
                {user ? (
                  <NavLink
                    className="px-2 py-2 flex items-center text-s leading-snug text-black hover:no-underline"
                    onClick={logout}
                    to="/"
                  >
                    <span className="ml-2">Log Out</span>
                  </NavLink>
                ) : (
                  <NavLink
                    onClick={() => setNavbarOpen(false)}
                    className="px-2 py-2 flex items-center text-s leading-snug text-black hover:opacity-110"
                    to="users/register"
                  >
                    <span className="ml-2">Sign Up</span>
                  </NavLink>
                )}
              </li>
              <li className="nav-item">
                <NavLink
                  onClick={() => setNavbarOpen(false)}
                  className="px-3 py-1 flex items-center justify-center text-s font-bold leading-snug text-white hover:scale-110 duration-300 hover:no-underline"
                  to="/cart"
                >
                  <svg
                    aria-hidden="true"
                    focusable="false"
                    className="w-10 h-10 "
                    role="img"
                    xmlns="http://www.w3.org/2000/svg"
                    viewBox="50 100 600 400"
